import React from 'react';
import {Button, Form} from "react-bootstrap";
import "../../css/chat.css"
const Chat = (props) => {
    return (
        <div className="input_text">
            <Form>
                <Form.Control type="text" placeholder="Write a message..." />
                <div className="d-grid gap-1">
                    <Button variant="secondary" type="submit">
                        Send
                    </Button>
                </div>
            </Form>
        </div>
    )
}

export default Chat
